import "./App.css";
import theme from "./Theme";
import { Button, ThemeProvider } from "@mui/material";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <h1>CCACC Potential Clients Tracker</h1>
        <Button variant="contained" color="primary">
          Test
        </Button>
      </div>
    </ThemeProvider>
  );
}

export default App;
